import React from 'react';
import { Link } from 'react-router-dom';

const SolidTile = props => {
  let tile;
  if (props.data.length > 0) {
    tile = (
      <Link to={props.to}>
        <div className="tile">
          <div className={'bar b-warning'}></div>
          <div className="text">
            <div>{props.top}</div>
            <div className="tile-icon">
              <i className={props.icon}></i>
            </div>
            <div>
              {props.bot} {props.data.length}
            </div>
          </div>
        </div>
      </Link>
    );
  } else {
    tile = (
      <Link to={props.to}>
        <div className="tile">
          <div className={'bar ' + props.progress}></div>
          <div className="text">
            <div>{props.top}</div>
            <div className="tile-icon">
              <i className={props.icon}></i>
            </div>
            <div>
              {props.bot} {props.data.length}
            </div>
          </div>
        </div>
      </Link>
    );
  }
  return <div className="col-2">{tile}</div>;
};

export default SolidTile;
